import UploadForm from "./components/UploadForm";
import ImageGallery from "./components/ImageGallery";

const App = () => {
  return (
    <div className="App">
      <header className="App-header">
      <h1>React Image Upload</h1>
      <UploadForm />
      <ImageGallery />
      </header>
    </div>
  );
};

export default App;
